			"en": "To tame a Fjordhawk, you must let it eat creatures you kill (wild or tamed). The taming increase varies depending on the creature it eats.\n\nBased on Dododex's testing of dozens of creatures, it generally prefers larger creatures such as the Brontosaurus, Diplodocus, or Parcer (all three were equal), however the size is not always correlated to how effective the creature is. The Ovis is the most effective creature to feed it. The Phiomia tames it very well in comparison to other easy-to-hunt dinos (even outperforming the Allosaurus and the Therizinosaurus).\n\nNote that the level of the creature it eats does not matter (a level 1 will increase the taming bar just as much as a level 150).\n\nShare which creatures worked best for you using the 'Tips' feature!",
