			"hr": "Da bi se ukrotio Fjordhawk, morate ga pustiti da jede stvorenja koja ubijate (divlja ili ukroÄ‡ena). PoveÄ‡anje u kroÄ‡enju varira ovisno o stvorenju koje jede.\n\nNa temelju Dododexovog testiranja desetaka stvorenja, opÄ‡enito preferira veÄ‡a stvorenja poput Brontosaura, Diplodokusa ili Parcera (sva tri su bila jednaka), meÄ‘utim veliÄina nije uvijek povezana s uÄinkovitoÅ¡Ä‡u stvorenja. Ovis je najuÄinkovitije stvorenje za hranjenje. Phiomia ga vrlo dobro ukroÄ‡uje u usporedbi s drugim lako lovnim dinosaurusima (Äak nadmaÅ¡uje Allosaurusa i Therizinosaurusa).\n\nNapomena da razina stvorenja koje jede nije bitna (razina 1 poveÄ‡at Ä‡e Å¡ipku za kroÄ‡enje jednako kao i razina 150).\n\nPodijelite koje su stvorenja najbolje funkcionirala za vas koristeÄ‡i znaÄajku 'Savjeti'!",
			"id": "Untuk menjinakkan Fjordhawk, Anda harus membiarkannya makan makhluk yang Anda bunuh (liar atau jinak). Peningkatan penjinakan berbeda-beda tergantung pada makhluk yang dimakannya.\n\nBerdasarkan pengujian Dododex pada puluhan makhluk, secara umum ia lebih menyukai makhluk yang lebih besar seperti Brontosaurus, Diplodocus, atau Parcer (ketiganya sama), namun ukurannya tidak selalu berkorelasi dengan seberapa efektif makhluk tersebut. Ovis adalah makhluk paling efektif untuk memberinya makan. Phiomia menjinakkannya dengan sangat baik dibandingkan dengan dinosaurus yang mudah diburu lainnya (bahkan melampaui Allosaurus dan Therizinosaurus).\n\nPerhatikan bahwa level dari makhluk yang dimakannya tidak masalah (level 1 akan meningkatkan bar penjinakan sama banyaknya dengan level 150).\n\nBagikan makhluk apa yang paling efektif untuk Anda menggunakan fitur 'Tips'!",
			"it": "Per addomesticare un Fjordhawk, devi lasciare che mangi le creature che uccidi (selvatiche o addomesticate). L'aumento dell'addomesticamento varia a seconda della creatura che mangia.\n\nIn base ai test di Dododex su decine di creature, preferisce in genere creature piÃ¹ grandi come il Brontosauro, Diplodocus o Parcer (tutti e tre erano uguali), tuttavia la dimensione non Ã¨ sempre correlata a quanto la creatura Ã¨ efficace. L'Ovis Ã¨ la creatura piÃ¹ efficace da nutrire. Il Phiomia lo addomestica molto bene in confronto ad altri dinosauri facili da cacciare (anche superando l'Allosaurus e il Therizinosaurus).\n\nNota che il livello della creatura che mangia non conta (un livello 1 aumenterÃ  la barra dell'addomesticamento tanto quanto un livello 150).\n\nCondividi quali creature hanno funzionato meglio per te utilizzando la funzione 'Suggerimenti'!",
