			"lv": "Lai pieradinÄtu Fjordhawk, jums ir jÄÄ¼auj tam Ä“st radÄ«bas, ko jÅ«s nogalinÄt (meÅ¾onÄ«gas vai pieradinÄtas). PieradinÄÅ¡anas pieaugums atÅ¡Ä·iras atkarÄ«bÄ no radÄ«bas, ko tÄ Ä“d.\n\nPamatojoties uz Dododex testÄ“Å¡anu ar desmitiem radÄ«bu, tas parasti dod priekÅ¡roku lielÄkÄm radÄ«bÄm, piemÄ“ram, Brontosaurus, Diplodocus vai Parcer (visi trÄ«s bija vienÄdi), tomÄ“r izmÄ“rs vienmÄ“r nav saistÄ«ts ar radÄ«bas efektivitÄti. Ovis ir visefektÄ«vÄkÄ radÄ«ba, ko barot. Phiomia to pieradina Ä¼oti labi salÄ«dzinÄjumÄ ar citiem viegli medÄ«jamiem dinozauriem (pat pÄrspÄ“j Allosaurus un Therizinosaurus).\n\nÅ…emiet vÄ“rÄ, ka radÄ«bas lÄ«menis, ko tÄ Ä“d, nav svarÄ«gs (lÄ«menis 1 palielinÄs pieradinÄÅ¡anas joslu tikpat daudz kÄ lÄ«menis 150).\n\nDalieties, kuras radÄ«bas jums labÄk darbojas, izmantojot funkciju 'Padomi'!",
			"nb": "For Ã¥ temme en Fjordhawk, mÃ¥ du la den spise skapninger du dreper (vill eller tammet). Tamming Ã¸kningen varierer avhengig av skapningen den spiser.\n\nBasert pÃ¥ Dododex's testing av titalls skapninger, foretrekker den generelt stÃ¸rre skapninger som Brontosaurus, Diplodocus, eller Parcer (alle tre var like), men stÃ¸rrelsen er ikke alltid korrelert til hvor effektiv skapningen er. Ovis er den mest effektive skapningen Ã¥ mate den med. Phiomia temmer den veldig bra i forhold til andre enkle-Ã¥-jakte dinosaurer (til og med utkonkurrerer Allosaurus og Therizinosaurus).\n\nMerk at nivÃ¥et pÃ¥ skapningen den spiser ikke har noen betydning (et nivÃ¥ 1 vil Ã¸ke temming baren like mye som et nivÃ¥ 150).\n\nDel hvilke skapninger som fungerte best for deg ved hjelp av 'Tips' funksjonen!",
			"nl": "Om een Fjordhawk te temmen, moet je hem laten eten van wezens die je doodt (wild of getemd). De toename van het temmen varieert afhankelijk van het wezen dat het eet.\n\nGebaseerd op Dododex's testen van tientallen wezens, geeft het over het algemeen de voorkeur aan grotere wezens zoals de Brontosaurus, Diplodocus, of Parcer (alle drie waren gelijk), echter is de grootte niet altijd gecorreleerd met hoe effectief het wezen is. De Ovis is het meest effectieve wezen om het te voeden. De Phiomia temt het zeer goed in vergelijking met andere makkelijk te jagen dino's (zelfs beter dan de Allosaurus en de Therizinosaurus).\n\nLet op dat het niveau van het wezen dat het eet er niet toe doet (een level 1 zal de tembalk net zoveel verhogen als een level 150).\n\nDeel welke wezens het beste voor jou werkten met behulp van de 'Tips' functie!",
			"pl": "Aby oswoiÄ‡ Fjordhawk, musisz pozwoliÄ‡ mu jeÅ›Ä‡ stworzenia, ktÃ³re zabijasz (dzikie lub oswojone). Wzrost oswojenia zaleÅ¼y od stworzenia, ktÃ³re zjada.\n\nNa podstawie testÃ³w Dododex z dziesiÄ…tkami stworzeÅ„, zazwyczaj preferuje on wiÄ™ksze stworzenia, takie jak Brontosaurus, Diplodocus, czy Parcer (wszystkie trzy byÅ‚y rÃ³wne), jednak wielkoÅ›Ä‡ nie zawsze koreluje ze skutecznoÅ›ciÄ… stworzenia. Ovis jest najskuteczniejszym stworzeniem do karmienia. Phiomia bardzo dobrze oswoi go w porÃ³wnaniu do innych Å‚atwych do polowania dinozaurÃ³w (nawet przewyÅ¼sza Allosaurus i Therizinosaurus).\n\nZauwaÅ¼, Å¼e poziom stworzenia, ktÃ³re zjada, nie ma znaczenia (poziom 1 zwiÄ™kszy pasek oswojenia rÃ³wnie duÅ¼o co poziom 150).\n\nPodziel siÄ™, ktÃ³re stworzenia dziaÅ‚aÅ‚y dla Ciebie najlepiej, uÅ¼ywajÄ…c funkcji 'WskazÃ³wki'!",
			"pt-br": "Para domar um Fjordhawk, vocÃª deve deixÃ¡-lo comer as criaturas que vocÃª mata (selvagem ou domesticado). O aumento da domesticaÃ§Ã£o varia dependendo da criatura que ele come.\n\nBaseado nos testes do Dododex com dezenas de criaturas, ele geralmente prefere criaturas maiores como o Brontosaurus, Diplodocus, ou Parcer (todos trÃªs eram iguais), no entanto, o tamanho nem sempre estÃ¡ correlacionado com a eficÃ¡cia da criatura. O Ovis Ã© a criatura mais eficaz para alimentÃ¡-lo. O Phiomia o domestica muito bem em comparaÃ§Ã£o a outros dinossauros fÃ¡ceis de caÃ§ar (mesmo superando o Allosaurus e o Therizinosaurus).\n\nNote que o nÃ­vel da criatura que ele come nÃ£o importa (um nÃ­vel 1 aumentarÃ¡ a barra de domesticaÃ§Ã£o tanto quanto um nÃ­vel 150).\n\nCompartilhe quais criaturas funcionaram melhor para vocÃª usando a funÃ§Ã£o 'Dicas'!",
